import React, {Component} from "react";
import ArticleLists from "./articleList";
import './App.css';
import {  BrowserRouter,  Routes,  Route,} from "react-router-dom";

class App extends Component{
    constructor(props){
        super(props);
        this.state = {
                data:  {}
            }
    }

    componentDidMount() {
        this.callBoard();
    }


    callBoard = async () => {
        const RES = await fetch('/board')
                        .then((res) => res.json())
        return this.setState(this.state=RES);
    }

    render(){
        return(
            <div className="App">
                {/* Every Article List : 
                <ul id="ulNone"><ArticleLists ArticleLists={this.state} /></ul> */}
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<ul id="ulNone">Every Article List : <ArticleLists ArticleLists={this.state} /></ul>} />
                    </Routes>
              </BrowserRouter>
            </div>
        );
    }
}

export default App;


